DECLARE @sql nvarchar(MAX) 
SET @sql = N'' 

SELECT @sql = @sql + N'ALTER TABLE ' + QUOTENAME(KCU1.TABLE_SCHEMA) 
    + N'.' + QUOTENAME(KCU1.TABLE_NAME) 
    + N' DROP CONSTRAINT ' -- + QUOTENAME(rc.CONSTRAINT_SCHEMA)  + N'.'  -- not in MS-SQL
    + QUOTENAME(rc.CONSTRAINT_NAME) + N'; ' + CHAR(13) + CHAR(10) 
FROM INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS AS RC 

INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE AS KCU1 
    ON KCU1.CONSTRAINT_CATALOG = RC.CONSTRAINT_CATALOG  
    AND KCU1.CONSTRAINT_SCHEMA = RC.CONSTRAINT_SCHEMA 
    AND KCU1.CONSTRAINT_NAME = RC.CONSTRAINT_NAME 

EXECUTE(@sql) 

GO
DECLARE @sql2 NVARCHAR(max)=''

SELECT @sql2 += ' Drop table ' + QUOTENAME(TABLE_SCHEMA) + '.'+ QUOTENAME(TABLE_NAME) + '; '
FROM   INFORMATION_SCHEMA.TABLES
WHERE  TABLE_TYPE = 'BASE TABLE'

Exec Sp_executesql @sql2 
GO 

---------------------------- Create table ----------------------------------
CREATE TABLE Customers (
    CustomerID INT PRIMARY KEY,
    FullName NVARCHAR(100) NOT NULL,
    Phone NVARCHAR(15) UNIQUE NOT NULL,
    Email NVARCHAR(100),
    CreatedDate DATETIME DEFAULT GETDATE()
);

CREATE TABLE Employees (
    EmployeeID INT PRIMARY KEY,
    FullName NVARCHAR(100) NOT NULL,
    Role NVARCHAR(50) CHECK (Role IN ('Waiter', 'Chef', 'Manager', 'Cashier')),
    HireDate DATE,
    Salary DECIMAL(10,2)
);

CREATE TABLE Tables (
    TableID INT PRIMARY KEY,
    TableNumber INT UNIQUE NOT NULL,
    Capacity INT CHECK (Capacity > 0),
    Location NVARCHAR(50)
);

CREATE TABLE Reservations (
    ReservationID INT PRIMARY KEY,
    CustomerID INT REFERENCES Customers(CustomerID),
    ReservationTime DATETIME NOT NULL,
    GuestCount INT CHECK (GuestCount > 0),
    Status NVARCHAR(20) CHECK (Status IN ('Pending', 'Confirmed', 'Arrived', 'No-Show', 'Cancelled')) DEFAULT 'Pending',
    Notes NVARCHAR(200)
);

CREATE TABLE ReservationTables (
    ReservationID INT REFERENCES Reservations(ReservationID),
    TableID INT REFERENCES Tables(TableID),
    PRIMARY KEY (ReservationID, TableID)
);

CREATE TABLE MenuItems (
    ItemID INT PRIMARY KEY,
    ItemName NVARCHAR(100) NOT NULL,
    Category NVARCHAR(50),
    Price DECIMAL(10,2) CHECK (Price > 0),
    IsAvailable BIT DEFAULT 1
);

CREATE TABLE Orders (
    OrderID INT  PRIMARY KEY,
    CustomerID INT REFERENCES Customers(CustomerID),
    EmployeeID INT REFERENCES Employees(EmployeeID),
    ReservationID INT NULL REFERENCES Reservations(ReservationID),
    OrderTime DATETIME DEFAULT GETDATE(),
    Status NVARCHAR(20) CHECK (Status IN ('Open', 'Completed', 'Cancelled')) DEFAULT 'Open',
    PaymentTime DATETIME NULL,
    PaymentMethod NVARCHAR(20) CHECK (PaymentMethod IN ('Cash', 'Credit Card', 'E-Wallet')) NULL,
    TotalAmount DECIMAL(10,2) NULL
);

CREATE TABLE OrderTables (
    OrderID INT REFERENCES Orders(OrderID),
    TableID INT REFERENCES Tables(TableID),
    PRIMARY KEY (OrderID, TableID)
);

CREATE TABLE OrderDetails (
    OrderID INT REFERENCES Orders(OrderID),
    ItemID INT REFERENCES MenuItems(ItemID),
    Quantity INT CHECK (Quantity > 0),
    Price DECIMAL(10,2) CHECK (Price > 0),
    PRIMARY KEY (OrderID, ItemID)
);


